g2:c.PROCEDURE.g2:a.TEXT:
TWNG-CALLBACK-TEST(node: class benchmark-node)

twng-id : float;
w: class g2-window;
err: symbol;
message: text;
is-twng: truth-value;
killed: truth-value;

begin
    conclude that the initial-value of COUNTER-1 = 0;
    
    twng-id = call start-twng-process();
    call assert-expression(twng-id > 0, "Can not create TWNG process");

    wait for 5 seconds;
    
    for w = each g2-window do
        is-twng = call is-twng-window(w);
        if is-twng then
        begin
            call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-1-1);
            call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-1-2);

            wait for 1 second;
            killed = call g2-kill-process(twng-id);
            call assert-expression(killed, "Can not kill TWNG process");
            
            wait for 5 seconds;
            call assert-expression(the initial-value of COUNTER-1 = 11, "Not all callbacks are called");
            call pass(node);
            return;
        end
    end;
    
    call fail(node, "There are none connected TWNG");
end
on error (err, message)
    call fail(node, message);
end

TWNG-CALLBACK-REMOVE-TEST(node: class benchmark-node)

twng-id : float;
w: class g2-window;
err: symbol;
message: text;
is-twng: truth-value;
killed: truth-value;

begin
    conclude that the initial-value of COUNTER-2 = 0;
    
    twng-id = call start-twng-process();
    call assert-expression(twng-id > 0, "Can not create TWNG process");

    wait for 5 seconds;
    
    for w = each g2-window do
        is-twng = call is-twng-window(w);
        if is-twng then
        begin
            call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-2-1);
            call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-2-2);

            { unregister a one callback}
            call g2-unregister-callback-on-twng-exit(w, DISCONNECT-CALLBACK-2-2);

            wait for 1 second;
            killed = call g2-kill-process(twng-id);
            call assert-expression(killed, "Can not kill TWNG process");
            
            wait for 5 seconds;
            call assert-expression(the initial-value of COUNTER-2 = 1, "Too many callbacks are called");

            call pass(node);
            return;
        end
    end;
    
    call fail(node, "There are none connected TWNG");
end
on error (err, message)
    call fail(node, message);
end

