end

TWO-TWNG-CALLBACK-TEST(node: class benchmark-node)

twng-id-1 : float;
twng-id-2 : float;
w: class g2-window;
err: symbol;
message: text;
is-twng: truth-value;
killed: truth-value;

win-count: integer = 0;

begin
    call close-all-telewindows();

    conclude that the initial-value of COUNTER-4-1 = 0;
    conclude that the initial-value of COUNTER-4-2 = 0;
    
    { Start TWNG }
    twng-id-1 = call start-twng-process();
    call assert-expression(twng-id-1 > 0, "Can not create 1st TWNG process");

    twng-id-2 = call start-twng-process();
    call assert-expression(twng-id-2 > 0, "Can not create 2nd TWNG process");

    wait for 10 seconds;
    { Add callbacks }
    for w = each g2-window do
        is-twng = call is-twng-window(w);
        if is-twng then
        begin
            win-count = win-count + 1;
            call assert-expression(win-count <= 2, "Too many TWNG are connected");
            
            if win-count = 1 then
            begin
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-1-1);
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-2-1);
                
                { Unresigter all callbacks }
                call g2-unregister-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-2-1);
                call g2-unregister-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-1-1);
            end
            else if win-count = 2 then
            begin
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-1-2);
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-2-2);
                
                { Register all callbacks one more time }
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-2-2);
                call g2-register-callback-on-twng-exit(w, DISCONNECT-CALLBACK-4-1-2);
            end;
        end
    end;

    call assert-expression(win-count = 2, "Not all TWNG are connected");

    { Kill TWNG processes }
    wait for 1 second;
    killed = call g2-kill-process(twng-id-1);
    call assert-expression(killed, "Can not kill 1st TWNG process");

    killed = call g2-kill-process(twng-id-2);
    call assert-expression(killed, "Can not kill 2nd TWNG process");

    { Test results }
    wait for 10 seconds;
    call assert-expression(the initial-value of COUNTER-4-1 = 0, "To many 1st TWNG callbacks are called");
    call assert-expression(the initial-value of COUNTER-4-2 = 11, "To many 2st TWNG callbacks are called");

    call pass(node);
end
on error (err, message)
    call fail(node, message);
end

close-all-telewindows()

	is-twng: truth-value;
	win: class g2-window;

begin
    for win = each g2-window do
        is-twng = call is-twng-window(win);
        if is-twng then begin
            call g2-system-command(the symbol close-telewindows-connection, win, win, the symbol none);
        end;
    end;
end

start-twng-process() = (float)

port: text;
cmd: text;
process-id: float;

begin
    port = call g2-get-port-number-or-name();
    cmd = "twng localhost [port]";
    process-id = call g2-spawn-process-with-arguments(cmd);
    return process-id;
end

assert-expression(exp: truth-value, message: text)

e: class error;

begin
    if not(exp) then
    begin
        create an error e;
        conclude that the error-description of e = message;
        signal e;
    end
end
